export const GET_FILMS = 'GET_FILMS';
export const SET_FILM = 'SET_FILM'

const getMovies = () => {
    return {
        type: GET_FILMS,
        payload: MOCK_DATA,
    };
}

const INITIAL_STATE = {
  current: undefined,
  films: MOCK_DATA
};

const filmsReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case GET_FILMS:
        return {...state, films: action.payload}  
        break;
    case SET_FILM:
        return {...state, current: action.payload}    
    default:
      return state
  }
};

export default combineReducers({
  films: filmsReducer
});